export default class extends React.Component{
    render(){
        return <div>
                <header>Podcasts</header>
                
                <style jsx>{`
                header {
                    color: #fff;
                    background: #8756ca;
                    paddong: 15px;
                }
                `}
                
                </style>

                <style jsx global>{`
                body {background: white};
                `}</style>
            </div>
    }
}
